import React from 'react';
import BasicSelect from '../../Components/Select';
import BasicDatePicker from'../../Components/Data/Data'
import { TextField } from '@mui/material';
import { Button } from '@mui/material';
import { FormHelperText } from '@mui/material';
import './style.css'


// import { Container } from './styles';

function FormCadastro() {
  return (
      <>
      
      <div className='pai'>
        <div className='div0' >
          <TextField sx={{ m: 1, minWidth: 10 }} className='nRegistro' id="outlined-basic" label="Nº Registro" variant="outlined" />
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" label="Usuário do Cadastro" variant="outlined" />
          <BasicSelect sx={{ m: 1, minWidth: 80 }}className='selects'/> 
          <BasicDatePicker className='data'/>
        </div>
        <div className='div1'>
          <TextField sx={{ m: 1, Width: 10 }}id="outlined-basic" label="Cod " variant="outlined" />
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" label="Coligada" variant="outlined" />
          <Button sx={{ m: 1, minWidth: 10 }}variant="outlined">Atualizar Situacao</Button>
        </div>
        <div className='div2'>
          <TextField sx={{ m: 1}}id="outlined-basic" label="Cod. Filial" variant="outlined" />
          <TextField sx={{ m: 1 }}id="outlined-basic" label="Filial" variant="outlined" />
          <TextField sx={{ m: 1,Width: 10 }}id="outlined-basic" label="Setor" variant="outlined" />
        </div>
        <div className='div3'>
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" label="Id Pessoa" variant="outlined" />
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" label="Matricula" variant="outlined" />
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" label="Nome Completo" variant="outlined" />
        </div>
        <div className='div4'>
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" label="E-mail" variant="outlined" />
          <TextField sx={{ m: 1, minWidth: 10 }}id="outlined-basic" type="password"label="Senha" variant="outlined" />
          <FormHelperText>Senha (6 digitos)</FormHelperText>

        </div>
      </div>


      </>
  );
}

export default FormCadastro;
